import axios from 'axios';
import Multiselect from 'multiselect-react-dropdown';


function Schedule()
{
    const [arr, arrset] = useState([]);
    console.log("hbee");
    useEffect(() => {
        async function fetchapi()
        {
            try {
                const data = await axios.get("/user");
                console.log(data.data)
                arrset(data.data.data);
                } 
            catch (err) {
            console.log(err);
            }
        }
        fetchapi();
    }, [])
    const dat=[
        {name:"Abc",email:'abc123@gmail.com'}
    ];
    arr&& arr.map((ele,key)=>{
        dat.push({name:ele.name,email:ele.email})
    })
    // console.log(dat);
    const[options]=useState(dat);
    console.log(options)
    return(
        <>
            <h1>Schedule An Interview</h1>
            <div style={{width:'70%',justifyContent:'center',display:'flex'}}></div>
            <div className='App'>
            <h3>Select Canditates</h3>
            <Multiselect options={options} displayValue={options}/>
            </div>
        </>


    )
}

export default Schedule
